selector_to_html = {"a[href=\"#user-user-status-filter\"]": "<figure class=\"align-center\" id=\"user-user-status-filter\">\n<a class=\"reference internal image-reference\" href=\"../../_images/user-user-status-filter.jpeg\"><img alt=\"../../_images/user-user-status-filter.jpeg\" src=\"../../_images/user-user-status-filter.jpeg\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">User, User Homepage, Status Filter Dropdown</span><a class=\"headerlink\" href=\"#user-user-status-filter\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#filtering-the-user-table\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Filtering the User Table<a class=\"headerlink\" href=\"#filtering-the-user-table\" title=\"Link to this heading\">#</a></h3><p>The <strong>User</strong> table can be filtered by either of the following options:</p>", "a[href=\"#view-user-details\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">View User Details<a class=\"headerlink\" href=\"#view-user-details\" title=\"Link to this heading\">#</a></h2><p>To view a user\u2019s details:</p>", "a[href=\"#id1\"]": "<figure class=\"align-center\" id=\"id1\">\n<a class=\"reference internal image-reference\" href=\"../../_images/user-user-column-options.jpeg\"><img alt=\"../../_images/user-user-column-options.jpeg\" src=\"../../_images/user-user-column-options.jpeg\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">User, User, Column Options</span><a class=\"headerlink\" href=\"#id1\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#users\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Users<a class=\"headerlink\" href=\"#users\" title=\"Link to this heading\">#</a></h1><p>The <strong>User</strong> section allows you to manage and view <strong>User</strong> accounts.</p>", "a[href=\"#user-user-view-more-location\"]": "<figure class=\"align-center\" id=\"user-user-view-more-location\">\n<a class=\"reference internal image-reference\" href=\"../../_images/user-user-view-more-location.jpg\"><img alt=\"../../_images/user-user-view-more-location.jpg\" src=\"../../_images/user-user-view-more-location.jpg\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">User, User Homepage, View More Icon Location</span><a class=\"headerlink\" href=\"#user-user-view-more-location\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#navigating-the-user-details-homepage\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Navigating the User Details Homepage<a class=\"headerlink\" href=\"#navigating-the-user-details-homepage\" title=\"Link to this heading\">#</a></h3><p>The <strong>User Details</strong> page has various actions available at the bottom-right of the page, including the following options:</p>", "a[href=\"#user-detail-homepage\"]": "<figure class=\"align-center\" id=\"user-detail-homepage\">\n<a class=\"reference internal image-reference\" href=\"../../_images/user-detail-homepage.jpeg\"><img alt=\"../../_images/user-detail-homepage.jpeg\" src=\"../../_images/user-detail-homepage.jpeg\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">View User Details Homepage</span><a class=\"headerlink\" href=\"#user-detail-homepage\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#using-the-status-dropdown\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Using the Status Dropdown<a class=\"headerlink\" href=\"#using-the-status-dropdown\" title=\"Link to this heading\">#</a></h4><p>The <strong>Status</strong> dropdown can be used to filter the table by these options:</p>", "a[href=\"#user-user-action-column\"]": "<figure class=\"align-center\" id=\"user-user-action-column\">\n<a class=\"reference internal image-reference\" href=\"../../_images/user-user-action-column.jpeg\"><img alt=\"../../_images/user-user-action-column.jpeg\" src=\"../../_images/user-user-action-column.jpeg\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">User, User Homepage, Action Column</span><a class=\"headerlink\" href=\"#user-user-action-column\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#user-user-save-changes\"]": "<figure class=\"align-center\" id=\"user-user-save-changes\">\n<a class=\"reference internal image-reference\" href=\"../../_images/user-user-save-changes.jpeg\"><img alt=\"../../_images/user-user-save-changes.jpeg\" src=\"../../_images/user-user-save-changes.jpeg\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">User, User Homepage, Save Changes</span><a class=\"headerlink\" href=\"#user-user-save-changes\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#editing-user-details\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Editing User Details<a class=\"headerlink\" href=\"#editing-user-details\" title=\"Link to this heading\">#</a></h4><p>You can edit the following details on the <strong>User Details Homepage</strong>:</p>", "a[href=\"#user-actions-location\"]": "<figure class=\"align-center\" id=\"user-actions-location\">\n<a class=\"reference internal image-reference\" href=\"../../_images/user-actions-location.jpeg\"><img alt=\"../../_images/user-actions-location.jpeg\" src=\"../../_images/user-actions-location.jpeg\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">User Actions Location, Bottom Right</span><a class=\"headerlink\" href=\"#user-actions-location\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#user-homepage\"]": "<figure class=\"align-center\" id=\"user-homepage\">\n<a class=\"reference internal image-reference\" href=\"../../_images/user-user-homepage.jpeg\"><img alt=\"../../_images/user-user-homepage.jpeg\" src=\"../../_images/user-user-homepage.jpeg\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">User, User Homepage</span><a class=\"headerlink\" href=\"#user-homepage\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#user-details-homepage-infopanel\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">User Details Homepage Infopanel<a class=\"headerlink\" href=\"#user-details-homepage-infopanel\" title=\"Link to this heading\">#</a></h4>", "a[href=\"#user-details-page\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">User Details Page<a class=\"headerlink\" href=\"#user-details-page\" title=\"Link to this heading\">#</a></h3><p>The <strong>User Details</strong> page allows you to view and edit a specific User\u2019s details.</p>", "a[href=\"#user-user-hompage-filter-options\"]": "<figure class=\"align-center\" id=\"user-user-hompage-filter-options\">\n<a class=\"reference internal image-reference\" href=\"../../_images/user-user-hompage-filter-options.jpeg\"><img alt=\"../../_images/user-user-hompage-filter-options.jpeg\" src=\"../../_images/user-user-hompage-filter-options.jpeg\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">User, User Homepage, Filter Options</span><a class=\"headerlink\" href=\"#user-user-hompage-filter-options\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#navigating-the-user-table\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Navigating the User Table<a class=\"headerlink\" href=\"#navigating-the-user-table\" title=\"Link to this heading\">#</a></h2><p>The homepage displays a table of users with the following columns:</p>", "a[href=\"#save-changes\"]": "<img src='/_static/solo_app/Universal/Universal/buttons/save-changes.jpeg' alt='Save Changes' style='width:200px;'>", "a[href=\"#deactivate-button\"]": "<img src='/_static/solo_app/Universal/buttons/deactivate-button.jpeg' alt='Deactivate Button' style='width:200px;'>", "a[href=\"#reset-password\"]": "<img src='/_static/solo_app/User/User-Detail/reset-password.jpeg' alt='Reset Password' style='width:200px;'>", "a[href=\"#view-more-icon\"]": "<img src='/_static/solo_app/Universal/icons/view-more-icon.jpeg' alt='View More Icon' style='width:200px;'>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
